text_raw:
Good afternoon;
I realize that sometimes the challenges of office and corporate work create dissatisfaction and discontent. 
I thought I'd send a message to you all, in the hopes of cheering you up a bit.

Kenny;
I feel betrayed by your actions. I feel that you have not had the best interest of your employees at heart, and your actions have caused them much pain. I hope that you will somehow come to grasp the level of anguish they've experienced, and that it will turn you from the path of crime which you've embarked upon. 
Matt.
